
<html>
<head></head>
<script>	
var result = '';
for (let prop in window) {  
  if (typeof window[prop] === 'object' && window[prop] !== null) {   
        result  += prop
  }
}
var resultDiv = document.createElement('div');
resultDiv.innerHTML = result; 
document.body.appendChild(resultDiv);
</script>
</body>
</html>
